import { AcademicCapIcon } from "@heroicons/react/solid";
import React from "react";

{/* <AcademicCapIcon class="w-10 inline-block mb-4" /> */}

export default function Experience() {
  return (
    <section id="exp" class="text-white bg-gray-800 body-font">
      <div class="container px-10 py-10 mx-auto">
        <div class="mb-10">
          <h1 class="text-center md:text-5xl text-2xl mb-4">
            Experience
          </h1>
          <p class="text-base leading-relaxed xl:w-2/4 lg:w-3/4 mx-auto">
            From my education, personal projects, and jobs, I've learned these skills:
          </p>
        </div>
          <div class="relative flex justify-center">
            <img class="absolute opacity-25 left-10 my-auto md:w-2/5 w-1/2 mx-auto border-2 border-purple-400 rounded-lg my-5" src="https://i.imgur.com/vhTx76G.png"></img>
            <img class="absolute opacity-25 right-10 my-auto md:w-1/2 w-1/2 mx-auto border-2 border-purple-400 rounded-lg my-5" src="https://i.imgur.com/vhTx76G.png"></img>
            <img class="z-40 md:w-1/2 w-1/2 mx-auto my-auto border-2 border-purple-400 rounded-lg my-5" src="https://i.imgur.com/wuH1z1S.png"></img>
          </div>
      </div>
    </section>
  );
}
